sys_variable_value.value:
(function execute(inputs, outputs) {
  var stringArray = inputs.jsonString;
  var arrayLength = stringArray.length;
  var arr = [];
  for (var i = 0; i < arrayLength; i++) {
    arr.push(JSON.parse(stringArray[i]));
    gs.info("Segrate Payment "+stringArray[i]);
  }
  outputs.payment_terms = arr;
})(inputs, outputs);

